import React, { useState } from 'react';
import BootstrapTable from "react-bootstrap-table-next";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';

const data2 = [
 {
   id: 0,
   name: "banana",
   price: "0.25"
 },
 {
   id: 1,
   name: "spinach",
   price: "4.49"
 },
 {
   id: 2,
   name: "icecream",
   price: "4.99"
 },
 {
   id: 3,
   name: "bagel",
      price: "1.19"
 },
 {
   id: 4,
   name: "fish",
   price: "10.00"
 }
];

const columns2 = [
 {
   dataField: "id",
   hidden: true
 },
 {
   dataField: "name",
   text: "Grocery"
 },
 {
   dataField: "price",
   text: "Price"
 }
];


const SearchTable = () => {
 return (
   <BootstrapTable
     keyField=""
     data2={data2}
     columns2={columns2}
   />
 );
};

export default SearchTable;
